(494,1,"2016-04-25 19:44:06","2016-04-25 19:44:06","Welcome to the formatting page for this theme. We\'re glad you are interested in using this and want to show you how elements look.\n\n<strong>Want to see what a blockquote looks like?</strong>\n\n<blockquote>This is an example of a WordPress post, you could edit this to put information about your site so readers know where you are coming from. You can create as many posts as you like in order to share with your readers what is on your mind.</blockquote>\n\n<strong>Perhaps you\'d like to see what an unordered list looks like?</strong>\n\n<ul>\n<li>Unordered list item #1</li>\n<li>Unordered list item #2</li>\n<li>Unordered list item #3</li>\n</ul>\n\n<strong>Or you\'d prefer to see what an ordered list looks like?</strong>\n\n<ol>\n<li>Ordered list item #1</li>\n<li>Ordered list item #2</li>\n<li>Ordered list item #3</li>\n</ol>\n\n<strong>Care to see what the headings look like?</strong>\n\n<h1>Headline 1</h1>\n<h2>Headline 2</h2>\n<h3>Headline 3</h3>\n<h4>Headline 4</h4>\n<h5>Headline 5</h5>\n<h6>Headline 6</h6>\n\n<strong>How about the styling for threaded comments?</strong>\n\nStarting with Version 2.7, WordPress has support for threaded comments. This is where you reply to a comment that was previously made, and makes reading comments easier. Take a look at the <a href=\"/genesis-sample/threaded-comments/#comments\">comments of this post</a> and you will see.","Typography","","publish","closed","closed","","typography","","","2016-04-25 19:44:06","2016-04-25 19:44:06","",31,"http://demo.studiopress.com/genesis-sample/?page_id=485",0,"page","",0),
